import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-white shadow-sm">
      <div className="container mx-auto px-4 py-4 flex items-center justify-between">
        <Link to="/" className="flex items-center space-x-2">
          <span className="text-2xl font-bold">JobHuntly</span>
        </Link>
        
        <nav className="hidden md:flex items-center space-x-6">
          <Link to="/jobs" className="text-gray-600 hover:text-gray-900">Find Jobs</Link>
          <Link to="/companies" className="text-gray-600 hover:text-gray-900">Browse Companies</Link>
        </nav>

        <div className="flex items-center space-x-4">
          <Link to="/login" className="text-gray-600 hover:text-gray-900">Login</Link>
          <Link to="/register" className="bg-indigo-600 text-white px-4 py-2 rounded-lg hover:bg-indigo-700">
            Sign Up
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
